var sceneSetup = (function () {

    "use strict";
 
   //Create road with texture
   var loader_road = new THREE.TextureLoader();
   var path_road = "data:image/jpeg;base64,";
   loader_road.load( path_road,function(texture_road){

    texture_road.wrapS = THREE.RepeatWrapping;
    texture_road.wrapT = THREE.RepeatWrapping;
    texture_road.repeat.set( 4, 4 );
    var road = new THREE.Mesh(

            new THREE.BoxGeometry(2000, 1, 240),
            new THREE.MeshLambertMaterial({ map: texture_road }), //http://opengameart.org/sites/default/files/oga-textures/tunnel_road.jpg
            0
        );
        road.name = "road";
        road.receiveShadow = true;
        road.position.y = 1;
        road.position.z = -100;
        game.scene.add(road);
    });

    //Create grass with texture
   var loader_grass = new THREE.TextureLoader();
   var path_grass = "data:image/png;base64,";
   loader_grass.load( path_grass,function(texture_grass){

    texture_grass.wrapS = THREE.RepeatWrapping;
    texture_grass.wrapT = THREE.RepeatWrapping;
    texture_grass.repeat.set( 10, 10 );
    var material = new THREE.MeshLambertMaterial({ map: texture_grass });
        var ground = new THREE.Mesh(
            new THREE.BoxGeometry(2000, 1, 800),
            material,
            0
        );

        ground.name = "grass";
        ground.receiveShadow = true;
        ground.position.y = 0;
        ground.position.z = -300;
        game.scene.add(ground);
    });

   //Create lake with texture
   var loader_lake = new THREE.TextureLoader();
   var path_lake = "data:image/jpeg;base64,";
   loader_lake.load( path_lake,function(texture_lake){

    texture_lake.wrapS = THREE.RepeatWrapping;
    texture_lake.wrapT = THREE.RepeatWrapping;
    texture_lake.repeat.set( 1, 1);
     var lake = new THREE.Mesh(
            new THREE.BoxGeometry(2000, 1, 180),
            new THREE.MeshLambertMaterial({ map: texture_lake }), //http://opengameart.org/node/10510
            0
        );

        lake.name = "lake";
        lake.position.y = 1;
        lake.receiveShadow = true;
        lake.position.z = -466;
        game.scene.add(lake);
        
    });

   
    function createBoard(x, z) {
         //Create boards with texture
        var loader_board = new THREE.TextureLoader();
        var path_board = "data:image/jpeg;base64,";
        loader_board.load( path_board,function(texture_board){

            texture_board.wrapS = THREE.RepeatWrapping;
            texture_board.wrapT = THREE.RepeatWrapping;
            texture_board.repeat.set( 1, 1);   

            var board = new THREE.Mesh(
                new THREE.BoxGeometry(30, 15, 3),
                new THREE.MeshLambertMaterial({ map: texture_board }),
                0
            );

            var base = new THREE.Mesh(
                new THREE.CylinderGeometry(2, 2, 35),
                new THREE.MeshLambertMaterial({ ambient: 0x552211  }),
                0
            );

            board.position.set(x, 30, z);
            board.castShadow=true;
            board.add(base);
            base.position.y = -25;
            board.name = "board"; 
            game.scene.add(board);
        });
    }


    function addSceneObjects() {

        //boards
        for (var i = 0; i < 20; i++) {
            createBoard(support.getRand(-500, 500), support.getRand(-230, -350));
        }

 
        setupSceneLighting();
    }

    function setupSceneLighting(){

        var ambientLight = new THREE.AmbientLight(0xcccccc);
        game.scene.add(ambientLight);

        var spotLight = new THREE.SpotLight(0xffffff);
        //spotLight.castShadow = true;
        spotLight.position.set(0, 200, -50);
        game.scene.add(spotLight);

        var directinalLight = new THREE.DirectionalLight( 0xffffff, 0.8 );
        directinalLight.castShadow = true;
        directinalLight.position.set(0, 100, -50);
        game.scene.add(directinalLight);

         var directinalLight2 = new THREE.DirectionalLight( 0xffffff, 0.5 );
        directinalLight2.castShadow = true;
        directinalLight2.position.set(-112, 300, -550);
        game.scene.add(directinalLight2);

    }

    return {
        addSceneObjects: addSceneObjects
    }

})();

